    public function getTemplate(): CheckStringsBuilder
    {
        /** @var CheckStringsBuilder $template */
        $template = ( new CheckStringsBuilder() )
            ->setLineLength(static::LINE_LENGTH)

            ->textCenter("СУШИФОКС", 1, 15)
            ->textCenter("Вкусно & Быстро", 3, 15)
            ->emptyLines(1)
            ->textCenter("8 (812) 338 - 1111", 3, 15)
            ->textCenter("www.sushifox.ru", 3, 15)
            ->emptyLines(1)
            ->textCenter("*****", 3, 15)
            ->emptyLines(5)

            ->textCenter("Заказ")
            ->textCenter("*** 0077-10 ***", 1, 1)
            ->emptyLines(2)

            ->twoColsText(["Состав заказа", "12.03.2020 12:00"])

            ->emptyLines(1)
            ->lineSeparator('-')
            ->emptyLines(1)

            ->twoColsText(["ролл Калифорния  х2", "300р"])
            ->text("мод. половинка", 4)
            ->emptyLines(1)

            ->twoColsText(["ролл Калифорния  х3", "300р"])
            ->emptyLines(1)

            ->twoColsText(["ролл Калифорния темпуро  х2", "500р"])
            ->text("мод. половинка", 4)
            ->emptyLines(1)

            ->lineSeparator('-')
            ->emptyLines(1);


        $template

            ->twoColsText(["К оплате:", "5000р"], 2, 14)
            ->emptyLines(1)
            ->twoColsText(["Тип оплаты:", "Банковской картой"])
            ->emptyLines(3)

            ->textCenter("Адрес")
            ->textCenter("пр-кт Просвещения д. 75, кв 2, подъезд угловой", 3)
            ->emptyLines(3)

            ->textCenter("Андрей, приятного аппетита!")
            ->emptyLines(5)

            ->textCenter("Отсканируй", 4, 7)
            ->textCenter("чтобы просмотреть заказ онлайн", 4, 7)

            //->qrCode("https://www.sushifox.ru")
            ->image($this->getQrCodeImageBase64())
            ->emptyLines(1);

        return $template;
    }


    public function isPrintable(): bool
    {
        // Проверка нужно ли печатать чек
        return true;
    }

